column8:
洋服や小物がまとめて収納可能な、光沢のあるホワイトのおしゃれなハンガーです♪<br>
場所をとらないスリムタイプです！<br>
<br>
●商品サイズ（cm）：幅約47ｘ奥行約47ｘ高さ約175<br>
●重量（kg）：約1.91<br>
●材質：スチール（粉体塗装）、ABS樹脂<br>
●耐荷重：全体20kg、上各1kg、中各2kg、下各2kg<br><style type="text/css">

